"use strict";(self.webpackChunkblog=self.webpackChunkblog||[]).push([[1466],{37410:(e,s,a)=>{a.r(s),a.d(s,{data:()=>n});const n={key:"v-5876e284",path:"/linux/%E5%8E%8B%E7%BC%A9%E5%92%8C%E8%A7%A3%E5%8E%8B.html",title:"Linux压缩和解压笔记",lang:"en-US",frontmatter:{date:"2021/12/18 14:35",title:"Linux压缩和解压笔记"},excerpt:"",headers:[{level:2,title:"gzip/gunzip",slug:"gzip-gunzip",children:[]},{level:2,title:"zip/unzip",slug:"zip-unzip",children:[]},{level:2,title:"tar",slug:"tar",children:[]}],git:{updatedTime:1654857597e3,contributors:[{name:"qsyyke",email:"2291308094@qq.com",commits:1}]}}},54410:(e,s,a)=>{a.r(s),a.d(s,{default:()=>d});var n=a(66252);const i=(0,n.uE)('<h2 id="gzip-gunzip" tabindex="-1"><a class="header-anchor" href="#gzip-gunzip" aria-hidden="true">#</a> gzip/gunzip</h2><p>gzip 用于压缩文件， gunzip 用于解压的</p><div class="language-bash ext-sh line-numbers-mode"><pre class="language-bash"><code><span class="token function">gzip</span> 文件\ngunzip 文件.gz\n</code></pre><div class="line-numbers"><span class="line-number">1</span><br><span class="line-number">2</span><br></div></div><div class="custom-container warning"><p class="custom-container-title">WARNING</p><p><code>gzip</code>只能将文件压缩为<code>.gz</code>文件，对于文件夹不能使用</p></div><ul><li><p>将<code>a.txt</code>文件压缩为<code>a.txt.gz</code>文件</p><div class="language-bash ext-sh line-numbers-mode"><pre class="language-bash"><code><span class="token function">gzip</span> a.txt\n</code></pre><div class="line-numbers"><span class="line-number">1</span><br></div></div><p>如果使用上面那个命令，那么在当前文件夹下，不会存在a.txt,只会存在a.gz文件</p></li><li><p>将<code>a.txt.gz</code>文件解压为<code>a.txt</code></p><div class="language-bash ext-sh line-numbers-mode"><pre class="language-bash"><code>gunzip a.txt.gz\n</code></pre><div class="line-numbers"><span class="line-number">1</span><br></div></div></li></ul><h2 id="zip-unzip" tabindex="-1"><a class="header-anchor" href="#zip-unzip" aria-hidden="true">#</a> zip/unzip</h2><p>zip 用于压缩文件， unzip 用于解压的，这个在项目打包发布中很有用的</p><div class="language-bash ext-sh line-numbers-mode"><pre class="language-bash"><code><span class="token function">zip</span> <span class="token punctuation">[</span>选项<span class="token punctuation">]</span> 文件名称.zip 压缩路径 \n<span class="token function">unzip</span> <span class="token punctuation">[</span>选项<span class="token punctuation">]</span> XXX.zip\n</code></pre><div class="line-numbers"><span class="line-number">1</span><br><span class="line-number">2</span><br></div></div><div class="custom-container tip"><p class="custom-container-title">TIP</p><p>此zip可以压缩文件夹，而不局限于文件</p></div>',9),c=(0,n._)("p",null,[(0,n._)("img",{src:"https://ooszy.cco.vin/img/blog-public/ljz.gif",alt:"",originSrc:"https://picture.xcye.xyz/image-20211218144217717.png?x-oss-process=style/pictureProcess1",data:"aurora"})],-1),p=(0,n.uE)('<blockquote><p>常用选项</p><p><code>-r</code>：递归压缩，即压缩目录,对于<code>zip</code>指令</p><p><code>-d&lt;目录&gt;</code> ：指定解压后文件的存放目录,对于<code>unzip</code>指令</p></blockquote><ul><li><p>将 /home 下的 所有文件/文件夹进行压缩成 myhome.zip</p><div class="language-bash ext-sh line-numbers-mode"><pre class="language-bash"><code><span class="token function">zip</span> -r myhome.zip /home\n</code></pre><div class="line-numbers"><span class="line-number">1</span><br></div></div><blockquote><p><code>zip -r myhome.zip /home/*</code>其还是压缩home目录，并不只是home目录内的所有文件</p><div class="language-bash ext-sh line-numbers-mode"><pre class="language-bash"><code><span class="token function">zip</span> -r myhome /home <span class="token comment">#虽然没有写myhome.zip，但是最后也会自动加上.zip</span>\n</code></pre><div class="line-numbers"><span class="line-number">1</span><br></div></div></blockquote></li><li><p>解压<code>myhome.zip </code>文件到<code>/files/un</code>目录下</p><div class="language-bash ext-sh line-numbers-mode"><pre class="language-bash"><code><span class="token function">unzip</span> -d /files/un myhome.zip\n</code></pre><div class="line-numbers"><span class="line-number">1</span><br></div></div><p>如果我们解压一个文件，但是解压到的目录中，已经存在同名文件，这个时候，会提示我们另外的选项，如重命名</p></li></ul><h2 id="tar" tabindex="-1"><a class="header-anchor" href="#tar" aria-hidden="true">#</a> tar</h2><p><code>tar</code>指令 是打包指令，最后打包后的文件是<code>.tar.gz</code>的文件。</p><div class="language-bash ext-sh line-numbers-mode"><pre class="language-bash"><code><span class="token function">tar</span> <span class="token punctuation">[</span>选项<span class="token punctuation">]</span> XXX.tar.gz\n</code></pre><div class="line-numbers"><span class="line-number">1</span><br></div></div>',5),l=(0,n._)("p",null,[(0,n._)("img",{src:"https://ooszy.cco.vin/img/blog-public/ljz.gif",alt:"",originSrc:"https://picture.xcye.xyz/image-20211218145749133.png?x-oss-process=style/pictureProcess1",data:"aurora"})],-1),o=(0,n.uE)('<ul><li><p>压缩多个文件，将 /home/pig.txt 和 /home/cat.txt 压缩成 pc.tar.gz</p><div class="language-bash ext-sh line-numbers-mode"><pre class="language-bash"><code><span class="token function">tar</span> -zcvf pc.tar.gz /home/pig.txt /home/cat.txt\n</code></pre><div class="line-numbers"><span class="line-number">1</span><br></div></div><blockquote><p><code>经过测试发现，tar指令，一定要加上四个选项，否则会报错，打包就是cvfz必须</code></p><p><code>如果同时将多个文件，打包到一个.tar.gz</code>文件中，那么多个文件中间以空格隔开就行</p></blockquote></li><li><p>将/home 的文件夹 压缩成 myhome.tar.gz</p><div class="language-bash ext-sh line-numbers-mode"><pre class="language-bash"><code><span class="token function">tar</span> -zcvf myhome.tar.gz /home/\n</code></pre><div class="line-numbers"><span class="line-number">1</span><br></div></div><blockquote><p>如果我们<code>tar -zcvf myhome /home</code>这种也会成功，但是最后并不会自动加上<code>.tar.gz</code>后缀名，最后的名字就是<code>myhome</code></p><p><code>tar -zcvf myhome.tar /home</code>这个最后的文件名为<code>myhome.tar</code></p></blockquote></li><li><p>将 pc.tar.gz 解压到当前目录</p><div class="language-bash ext-sh line-numbers-mode"><pre class="language-bash"><code><span class="token function">tar</span> -zxfv pc.tar.gz\n</code></pre><div class="line-numbers"><span class="line-number">1</span><br></div></div></li><li><p>将myhome.tar.gz 解压到 /opt/tmp2目录下</p><div class="language-bash ext-sh line-numbers-mode"><pre class="language-bash"><code><span class="token function">mkdir</span> /opt/tmp2\n<span class="token function">tar</span> -zxvf /home/myhome.tar.gz -C /opt/tmp2\n</code></pre><div class="line-numbers"><span class="line-number">1</span><br><span class="line-number">2</span><br></div></div><blockquote><p><code>这里一定要注意，一定要加上-C，-C后面是路径</code>，并且<code>-C</code>是大写，否则不会成功</p></blockquote></li></ul>',1),t={},d=(0,a(83744).Z)(t,[["render",function(e,s){return(0,n.wg)(),(0,n.iD)(n.HY,null,[i,c,p,l,o],64)}]])}}]);